import React from 'react';
import { ListGroup } from 'react-bootstrap';

const GeneralInfoSidebar = () => {
  return (
    <div className="sidebar-section">
      <ListGroup>
        <ListGroup.Item active>Información general</ListGroup.Item>
        <ListGroup.Item action href="#">Inicio</ListGroup.Item>
        <ListGroup.Item action href="#">La Asociación</ListGroup.Item>
        <ListGroup.Item action href="#">Redes Sociales</ListGroup.Item>
        <ListGroup.Item action href="#">Nuestro albergue</ListGroup.Item>
        <ListGroup.Item action href="#">Profesionales colaboradores</ListGroup.Item>
        <ListGroup.Item action href="#">Contacto</ListGroup.Item>
        <ListGroup.Item action href="#">Calendario de google</ListGroup.Item>
      </ListGroup>
    </div>
  );
};

export default GeneralInfoSidebar;
